    "summary": "Herb Roasted Chicken might be just the main course you are searching for. This recipe makes 6 servings with <b>425 calories</b>, <b>21g of protein</b>, and <b>32g of fat</b> each. For <b>$1.22 per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. 32 people were impressed by this recipe. It is a good option if you're following a <b>gluten free and fodmap friendly</b> diet. From preparation to the plate, this recipe takes about <b>4 hours</b>. A mixture of basil, brown sugar, coarse pepper, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the brown sugar you could follow this main course with the <a href=\"https://spoonacular.com/recipes/brown-sugar-pound-cupcakes-with-brown-butter-glaze-63777\">Brown-sugar Pound Cupcakes With Brown-butter Glaze</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 40%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/herb-roasted-whole-chicken-497426\">Herb Roasted Whole Chicken</a>, <a href=\"https://spoonacular.com/recipes/herb-roasted-chicken-136389\">Herb Roasted Chicken</a>, and <a href=\"https://spoonacular.com/recipes/herb-roasted-whole-chicken-612874\">Herb Roasted Whole Chicken</a> for similar recipes.",
