    "summary": "Saffron Chicken Tikkan is a main course that serves 3. For <b>$1.44 per serving</b>, this recipe <b>covers 15%</b> of your daily requirements of vitamins and minerals. One serving contains <b>159 calories</b>, <b>25g of protein</b>, and <b>4g of fat</b>. If you have pepper corns, cloves, an of saffron, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>gluten free</b> diet. 34 people were impressed by this recipe. It is a <b>rather inexpensive</b> recipe for fans of Indian food. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 59%</b>, which is pretty good. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/saffron-marinated-chicken-skewers-kesari-malai-tikka-198909\">Saffron-Marinated Chicken Skewers (Kesari Malai Tikka)</a>, <a href=\"https://spoonacular.com/recipes/chicken-tikka-how-to-make-chicken-tikka-in-oven-666060\">chicken tikka , how to make chicken tikkan in oven</a>, and <a href=\"https://spoonacular.com/recipes/chicken-tikka-masala-how-to-make-chicken-tikka-masala-665989\">chicken tikka masala , how to make chicken tikka masala</a>.",
