    "summary": "You can never have too many side dish recipes, so give Parmesan Mashed Potatoes a try. One serving contains <b>687 calories</b>, <b>16g of protein</b>, and <b>51g of fat</b>. For <b>$1.44 per serving</b>, this recipe <b>covers 17%</b> of your daily requirements of vitamins and minerals. It is a good option if you're following a <b>gluten free</b> diet. Not a lot of people made this recipe, and 9 would say it hit the spot. If you have butter, cream, salt and pepper, and a few other ingredients on hand, you can make it. It will be a hit at your <b>Thanksgiving</b> event. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 50%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/parmesan-mashed-potatoes-298926\">Parmesan Mashed Potatoes</a>, <a href=\"https://spoonacular.com/recipes/buttermilk-parmesan-mashed-potatoes-215001\">Buttermilk-Parmesan Mashed Potatoes</a>, and <a href=\"https://spoonacular.com/recipes/nannys-parmesan-mashed-potatoes-878138\">Nanny's Parmesan Mashed Potatoes</a> for similar recipes.",
