    "summary": "You can never have too many condiment recipes, so give Arugula Walnut Pesto a try. This recipe serves 4. One portion of this dish contains about <b>2g of protein</b>, <b>9g of fat</b>, and a total of <b>86 calories</b>. For <b>44 cents per serving</b>, this recipe <b>covers 3%</b> of your daily requirements of vitamins and minerals. 28 people have made this recipe and would make it again. A mixture of arugula, garlic, walnuts, and a handful of other ingredients are all it takes to make this recipe so yummy. It is a good option if you're following a <b>gluten free and primal</b> diet. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 58%</b>, which is pretty good. Similar recipes are <a href=\"https://spoonacular.com/recipes/arugula-walnut-pesto-489854\">Arugula Walnut Pesto</a>, <a href=\"https://spoonacular.com/recipes/arugula-walnut-pesto-8289\">Arugula Walnut Pesto</a>, and <a href=\"https://spoonacular.com/recipes/arugula-and-walnut-pesto-476027\">Arugulan and Walnut Pesto</a>.",
