    "summary": "The recipe Vietnamese Pancakes with Vegetables, Herbs and a Fragrant Dipping Sauce (Bánh Xèo) is ready <b>in approximately 45 minutes</b> and is definitely an awesome <b>gluten free, dairy free, and vegetarian</b> option for lovers of Vietnamese food. For <b>$3.19 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. This recipe makes 6 servings with <b>377 calories</b>, <b>8g of protein</b>, and <b>21g of fat</b> each. It will be a hit at your <b>The Super Bowl</b> event. 295 people were impressed by this recipe. Head to the store and pick up sesame oil, sea salt, egg, and a few other things to make it today. It works well as a side dish. All things considered, we decided this recipe <b>deserves a spoonacular score of 94%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/bnh-xo-vietnamese-happy-pancakes-891106\">Bánh xèo (Vietnamese Happy Pancakes)</a>, <a href=\"https://spoonacular.com/recipes/vietnamese-fried-egg-banh-mi-recipe-banh-mi-trung-op-la-the-41453\">Vietnamese Fried Egg Banh Mi Recipe (banh Mi Trung Op La)- “the</a>, and <a href=\"https://spoonacular.com/recipes/vietnamese-dipping-sauce-594932\">Vietnamese Dipping Sauce</a> for similar recipes.",
