    "summary": "Forget going out to eat or ordering takeout every time you crave Mediterranean food. Try making Strawberry Cheesecake Chocolate Crepes at home. This recipe serves 4. One serving contains <b>638 calories</b>, <b>16g of protein</b>, and <b>38g of fat</b>. For <b>$1.69 per serving</b>, this recipe <b>covers 20%</b> of your daily requirements of vitamins and minerals. This recipe from Pink When has 1928 fans. Several people really liked this breakfast. <b>Mother's Day</b> will be even more special with this recipe. From preparation to the plate, this recipe takes around <b>40 minutes</b>. If you have cream cheese, cocoa powder, granulated sugar, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. With a spoonacular <b>score of 0%</b>, this dish is very bad (but still fixable). Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/strawberry-cheesecake-crepes-1104545\">Strawberry Cheesecake Crepes</a>, <a href=\"https://spoonacular.com/recipes/chocolate-strawberry-crepes-306701\">Chocolate-Strawberry Crepes</a>, and <a href=\"https://spoonacular.com/recipes/chocolate-strawberry-crepes-with-caramel-sauce-294513\">Chocolate Strawberry Crepes with Caramel Sauce</a>.",
