    "summary": "Chili chops with cauliflower salad might be just the main course you are searching for. This gluten free recipe serves 4 and costs <b>$3.0 per serving</b>. One serving contains <b>454 calories</b>, <b>34g of protein</b>, and <b>26g of fat</b>. 10 people have made this recipe and would make it again. It is perfect for <b>The Super Bowl</b>. Head to the store and pick up canned tomatoes, salt, tarragon, and a few other things to make it today. To use up the salt and pepper you could follow this main course with the <a href=\"https://spoonacular.com/recipes/dr-pepper-cake-with-flour-cooked-frosting-539165\">Dr. Pepper Cake with Flour Cooked Frosting</a> as a dessert. This recipe is typical of American cuisine. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 88%</b>. This score is great. Try <a href=\"https://spoonacular.com/recipes/lamb-chops-with-cauliflower-and-raisins-15646\">Lamb Chops with Cauliflower and Raisins</a>, <a href=\"https://spoonacular.com/recipes/chili-chops-399509\">Chili Chops</a>, and <a href=\"https://spoonacular.com/recipes/chili-chops-417937\">Chili Chops</a> for similar recipes.",
