    "instructions": "<ol><li>Season chops with salt and pepper and brown them in a nonstick skillet over medium-high heat for about 2 minutes per side.</li><li>Combine salsa, chilies and cumin in a bowl. Pour mixture over chops. Reduce heat to low, cover skillet and simmer chops 5 minutes or until cooked through.</li><li>Mix cheeses in a bowl. Divide cheese mixture over chops, cover and cook 1 minute, just until cheese melts.</li><li>Cauliflower salad:</li><li>Cook cauliflower florets in a large pot of salted, boiling water until tender-crisp, 5 to 10 minutes. Drain and rinse under cold water.</li><li>Or cook in MWC for 15 minutes.</li><li>In a large bowl, combine mayonnaise, lemon juice and tarragon. Add cauliflower, jalapeno, salt and pepper.</li><li>Mix well until cauliflower florets are evenly coated with dressing. Chill at least 30 minutes for flavors to blend. (Can be made ahead. Store in an airtight container and refrigerate up to 24 hours.)</li><li>Sprinkle with parsley just before serving.</li></ol>",
