    "id": 1045245,
    "title": "How to make the perfect Chocolate Chip Eggnog Bars",
    "readyInMinutes": 45,
    "servings": 9,
    "sourceUrl": "https://www.pinkwhen.com/chocolate-chip-eggnog-bars/",
    "image": "https://spoonacular.com/recipeImages/1045245-556x370.jpg",
    "imageType": "jpg",
    "summary": "How to make the perfect Chocolate Chip Eggnog Bars is a beverage that serves 9. One portion of this dish contains approximately <b>4g of protein</b>, <b>20g of fat</b>, and a total of <b>282 calories</b>. For <b>60 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. Only a few people made this recipe, and 7 would say it hit the spot. It can be enjoyed any time, but it is especially good for <b>Christmas</b>. If you have oreo cookies, granulated sugar, nutmeg, and a few other ingredients on hand, you can make it. It is brought to you by Pink When. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 15%</b>. This score is rather bad. <a href=\"https://spoonacular.com/recipes/eggnog-chocolate-chip-bread-with-brown-butter-eggnog-glaze-525211\">Eggnog Chocolate Chip Bread with Brown Butter Eggnog Glaze</a>, <a href=\"https://spoonacular.com/recipes/spiced-eggnog-chocolate-chip-cake-595484\">Spiced Eggnog Chocolate Chip Cake</a>, and <a href=\"https://spoonacular.com/recipes/white-chocolate-chip-eggnog-muffins-621799\">White Chocolate Chip Eggnog Muffins</a> are very similar to this recipe.",
    "cuisines": [ ],
