    "instructions": "To get started, place 1/4 cup of olive oil into a medium saucepan and allow to heat on medium heat. Once warm, place zucchini in pan and then sprinkle with garlic salt and cajun seasoning. Toss with tongs to get all of the zucchini coated with oil and seasoning. Cover with a lid and steam for two to three minutes. Remove lid, toss zucchini noodles again and then cover for another 2 minutes. Remove from heat.In the mean time, place the basil, garlic, and grated parmesan cheese into a food processor. Slowly add the olive oil, and then set to the side.Add zucchini noodles, pesto, and chicken to a medium dish and toss until everything is fully coated. Serve immediately.This is seriously, SO GOOD!If you are looking for more healthy recipes like this Pesto Chicken Zoodles recipe, check out the Simple Fit Forty Section of this blog, or consider joining our secret Facebook group where we share all things healthy.If you are not making this TODAY, then make sure you pin this for later! Its a keeper.JOIN 500,000 SUBSCRIBERS!Join over 500,000 others who follow PinkWhen on Social Media, the PinkWhen blog, and email. Sign up to receive exclusive bonuses like this FREE Simple Fit Dinners Ebook.Don't wait! You won't want to miss a thing.Success! Now check your email to confirm your subscription and download your FREE ebook.There was an error submitting your subscription. Please try again.First NameEmail AddressSubscribePowered by ConvertKit",
