    "instructions": "<ol><li>In a small mixing bowl or blender, combine all of the ingredients for the balsamic marinade except for the lemon juice (balsamic vinegar, apple cider vinegar, 1 tbsp grapeseed oil, honey, dried dill, herbs de provence, salt and pepper).</li><li> Whisk or blend until oil and vinegar are well incorporated and no longer separate.</li><li>  Place salmon fillet in a baking dish (I use a small casserole dish). Pour the marinade over the salmon and allow it to marinate for at least 15 minutes (or up to 24 hours covered in the refrigerator). </li><li> Turn your oven on high broil. </li><li>Just before putting the salmon in the oven, drizzle the lemon juice over the fish. </li><li>Bake for 10 to 12 minutes on the top rack or until salmon is glazed, browned and sizzling.</li><li>While the salmon is baking, prepare the asparagus. </li><li> Wash the asparagus and cut off the bottom inch and a half of each stalk and discard.</li><li>  Spread the asparagus on in a large skillet. Drizzle the grapeseed oil over the asparagus and spread the oil on the asparagus with your hands so that all stalks are completely coated. </li><li> Sprinkle asparagus with desired amount of salt and pepper. </li><li>Saute over medium heat for 5 minutes. </li><li>Add the two tablespoons of vegetable stock and cover the skillet. </li><li>Saute 4 minutes. </li><li>Remove lid and add the minced garlic. </li><li>Place cover back over the asparagus. </li><li>Continue cooking an additional 3 to 5 minutes until asparagus is cooked but not too soft.  Grate lemon zest over the top of the asparagus.</li></ol>",
