    "summary": "Sardine Croquettes (Croquetas De Sardinas) is a <b>pescatarian</b> hor d'oeuvre. This recipe serves 14. One portion of this dish contains approximately <b>5g of protein</b>, <b>4g of fat</b>, and a total of <b>125 calories</b>. For <b>31 cents per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. A mixture of baking powder, cassava, egg whites, and a handful of other ingredients are all it takes to make this recipe so yummy. 10 people were impressed by this recipe. It is brought to you by Foodista. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. Overall, this recipe earns a <b>not so super spoonacular score of 34%</b>. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/croquetas-de-jamon-spanish-ham-croquettes-839612\">Croquetas de Jamon (Spanish Ham Croquettes)</a>, <a href=\"https://spoonacular.com/recipes/chicken-croquettes-croquetas-de-pollo-from-spain-469868\">Chicken Croquettes (Croquetas de Pollo) From 'Spain</a>, and <a href=\"https://spoonacular.com/recipes/the-redux-sea-what-youve-been-missing-canned-sardine-simple-sardine-toasts-525605\">{The Redux} Sea What You’ve Been Missing – Canned Sardine : Simple Sardine Toasts</a>.",
