    "summary": "Brownie Cheesecake might be just the <b>American</b> recipe you are searching for. This recipe makes 12 servings with <b>524 calories</b>, <b>6g of protein</b>, and <b>37g of fat</b> each. For <b>$1.11 per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up cookie crumbs, an of salt, butter, and a few other things to make it today. 10 people have made this recipe and would make it again. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 16%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/brownie-cheesecake-447421\">Brownie Cheesecake</a>, <a href=\"https://spoonacular.com/recipes/brownie-cheesecake-127653\">Brownie Cheesecake</a>, and <a href=\"https://spoonacular.com/recipes/brownie-cheesecake-131400\">Brownie Cheesecake</a> for similar recipes.",
