    "imageType": "jpg",
    "summary": "Roasted Cranberries, Ricotta & Honey Crostini might be just the hor d'oeuvre you are searching for. One serving contains <b>334 calories</b>, <b>3g of protein</b>, and <b>1g of fat</b>. For <b>84 cents per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. It can be enjoyed any time, but it is especially good for <b>Christmas</b>. This recipe is typical of Mediterranean cuisine. 548 people have made this recipe and would make it again. If you have roasted cranberry sauce, roasted cranberry sauce, honey, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 29%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/roasted-fig-ricotta-pistachio-honey-crostini-721464\">Roasted Fig, Ricotta, Pistachio & Honey Crostini</a>, <a href=\"https://spoonacular.com/recipes/honey-chipotle-roasted-parsnip-and-carrot-crostini-with-whipped-ricotta-and-pesto-619399\">Honey Chipotle-Roasted Parsnip and Carrot Crostini with Whipped Ricottan and Pesto</a>, and <a href=\"https://spoonacular.com/recipes/maple-honey-roasted-carrot-noodle-ricotta-crostini-with-coconut-flakes-563844\">Maple-Honey Roasted Carrot Noodle Ricotta Crostini with Coconut Flakes</a> for similar recipes.",
