    "summary": "Dark Shadows Baileys Chocolate Cheesecake Brownies might be just the <b>American</b> recipe you are searching for. One serving contains <b>435 calories</b>, <b>6g of protein</b>, and <b>29g of fat</b>. This recipe serves 16 and costs 94 cents per serving. 8 people were impressed by this recipe. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. If you have eggs, bittersweet chocolate, flour, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 29%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/baileys-dark-chocolate-guinness-bread-721519\">Baileys Dark Chocolate Guinness Bread</a>, <a href=\"https://spoonacular.com/recipes/baileys-dark-chocolate-candied-truffles-easy-five-ingredient-friday-524466\">Baileys® Dark Chocolate Candied Truffles (EASY) (Five Ingredient Friday)</a>, and <a href=\"https://spoonacular.com/recipes/fudgy-chocolate-cream-cheese-brownies-with-baileys-644081\">Fudgy chocolate cream cheese brownies with Baileys</a> for similar recipes.",
