    "imageType": "jpg",
    "summary": "The recipe The BEST Lemon Bars can be made <b>in about 45 minutes</b>. This recipe makes 6 servings with <b>796 calories</b>, <b>9g of protein</b>, and <b>34g of fat</b> each. For <b>92 cents per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. 1148 people were glad they tried this recipe. It works well as a dessert. Head to the store and pick up powdered sugar topping, granulated sugar, flour 2 cups, and a few other things to make it today. It is brought to you by Pink When. Taking all factors into account, this recipe <b>earns a spoonacular score of 0%</b>, which is improvable. Try <a href=\"https://spoonacular.com/recipes/easy-lemon-bars-lemon-squares-1084214\">Easy Lemon Bars (Lemon Squares)</a>, <a href=\"https://spoonacular.com/recipes/best-ever-lemon-brownie-bars-or-lemon-brownies-756889\">Best Ever Lemon Brownie Bars or Lemon Brownies</a>, and <a href=\"https://spoonacular.com/recipes/lemon-bars-225092\">Lemon bars</a> for similar recipes.",
