    "instructions": "Preheat oven to 350. Cover an 88 glass square dish with foil.Whisk together all of your crust ingredients until it becomes a grainy consistency. Take a spoon and press the graham crust into the foil making sure all of the edges and bottom are completely covered.Place into the oven and bake for 10-15 minutes until browned. Remove from oven and allow to cool for about an hour.For the filling, add all of your ingredients into a medium bowl and mix well for about 30 minutes, and then for 3 minutes on low. Place into the graham cracker crust, making sure all of the edges are filled.Bake in the oven for about 5-10 minutes, and then remove. Place onto a cooling rack for about 15 minutes, and then chill in the refrigerator for remaining 45 minutes to set.To serve, remove carefully from dish with foil and cut into bite sized squares.Looking for other ways to use Lime Essential Oil? A great group of bloggers and myself got together so we could share our favorite recipes to use with Lime. You dont have to use essential oils in order to make this delicious dessert, but if you have on hand, give it a try! You can find all of the other great Lime recipes below. Leave me a comment if you make these Creamy Lime Pie Square Bites and tell me if you love them as much as we do!If you have ever wanted to start using essential oils, you can read all about WHY I love to use mine here. Want to use Lime in a few different recipes? Check these additional recipes out.Coconut Lime Spritzer // Blackberry Lime Margaritas // Strawberry LimeadeCherry Lime Chia Energy Bars // Strawberry Margarita Cheesecake // Creamy Lime Pie BitesMargarita Crepe Cake //Edible Watermelon Bowl // Margarita CookiesSouthwestern Black Bean & Corn Salad // Lime Cheesecake ShootersNot all essential oils are edible. Due to lack of purity, 98% of essential oils sold should NOT be ingested. An edible essential oil will be labeled therapeutic-grade and have a Supplement Facts box on the label showing the nutritional value  do NOT use just any brand of essential oil for cooking/flavoring foods. Be sure to use pure oils from reliable sources, not synthetic scents or flavorings.JOIN 500,000 SUBSCRIBERS!Join over 500,000 others who follow PinkWhen on Social Media, the PinkWhen blog, and email. Sign up to receive exclusive bonuses like this FREE Simple Fit Dinners Ebook.Don't wait! You won't want to miss a thing.Success! Now check your email to confirm your subscription and download your FREE ebook.There was an error submitting your subscription. Please try again.First NameEmail AddressSubscribePowered by ConvertKit",
