    "summary": "Tangy & Savory Mexican Soup might be just the main course you are searching for. For <b>$2.21 per serving</b>, this recipe <b>covers 31%</b> of your daily requirements of vitamins and minerals. One serving contains <b>564 calories</b>, <b>26g of protein</b>, and <b>36g of fat</b>. 8 people have tried and liked this recipe. This recipe is typical of Mexican cuisine. It is perfect for <b>Autumn</b>. From preparation to the plate, this recipe takes around <b>45 minutes</b>. Head to the store and pick up lime juice, ground beef, cilantro, and a few other things to make it today. To use up the sour cream you could follow this main course with the <a href=\"https://spoonacular.com/recipes/sour-cream-apple-pie-70374\">Sour Cream Apple Pie</a> as a dessert. It is a good option if you're following a <b>gluten free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 83%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/tangy-bean-soup-405131\">Tangy Bean Soup</a>, <a href=\"https://spoonacular.com/recipes/tangy-asparagus-soup-414163\">Tangy Asparagus Soup</a>, and <a href=\"https://spoonacular.com/recipes/tangy-potato-soup-148020\">Tangy Potato Soup</a> for similar recipes.",
