    "summary": "The Scotch Egg takes roughly <b>roughly 45 minutes</b> from beginning to end. This recipe serves 6 and costs $1.75 per serving. One portion of this dish contains roughly <b>23g of protein</b>, <b>42g of fat</b>, and a total of <b>536 calories</b>. 10 people have tried and liked this recipe. A mixture of eggs, panko breadcrumbs, vegetable oil, and a handful of other ingredients are all it takes to make this recipe so scrumptious. It is a good option if you're following a <b>dairy free</b> diet. It works well as a beverage. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 41%</b>. This score is solid. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/scotch-egg-151282\">Scotch Egg</a>, <a href=\"https://spoonacular.com/recipes/scotch-egg-716363\">Scotch Egg</a>, and <a href=\"https://spoonacular.com/recipes/scotch-egg-78119\">Scotch Egg</a>.",
