    "occasions": [ ],
    "instructions": "<ol><li>Preheat the oven to 425F.</li><li>Heat butter and olive oil in a saucepan and saute the onion, garlic, celery, carrots and herbs until lightly golden. Add the vin santo or Marsala and bring to a boil. Boil for about 2 minutes, then remove from heat.</li><li>Place the meats, salt and pepper in a large bowl and mix together, then add the vegetables. Squeeze the bread of excess milk and break it into the mixture. Add the 2 raw eggs. Using your hands, combine mixture well.</li><li>Line a large rectangular terrine, casserole, or loaf pan (about 14 inches long) with foil and brush with oil. Place half of the meat mixture in the pan and press down evenly. Arrange the hard boiled eggs in a line down the center, then cover with the remaining meat mixture. Press the mixture down well.</li><li>Bake the loaf on the bottom shelf of the oven for about 50 minutes; it should be lightly browned on top. Turn onto a serving dish. It is delicious served hot or cold.</li></ol>",
