    "summary": "Buttery Pull Apart Monkey Bread takes about <b>about 45 minutes</b> from beginning to end. One serving contains <b>392 calories</b>, <b>6g of protein</b>, and <b>21g of fat</b>. This recipe serves 16. For <b>34 cents per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. 9 people have made this recipe and would make it again. Head to the store and pick up butter, flour, sugar, and a few other things to make it today. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. It is brought to you by Foodista. With a spoonacular <b>score of 28%</b>, this dish is rather bad. Try <a href=\"https://spoonacular.com/recipes/mini-apple-pull-apart-monkey-bread-628420\">Mini Apple Pull Apart Monkey Bread</a>, <a href=\"https://spoonacular.com/recipes/bananas-foster-pull-apart-monkey-bread-715482\">Banana’s Foster Pull Apart Monkey Bread</a>, and <a href=\"https://spoonacular.com/recipes/pull-apart-apple-fritter-monkey-bread-624522\">Pull Apart Apple Fritter Monkey Bread</a> for similar recipes.",
