    "summary": "Brown Butter Twice Baked Sweet Potatoes might be just the main course you are searching for. One serving contains <b>689 calories</b>, <b>16g of protein</b>, and <b>55g of fat</b>. For <b>$3.43 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. This recipe from Pink When has 8242 fans. From preparation to the plate, this recipe takes roughly <b>1 hour and 35 minutes</b>. Head to the store and pick up sweet potatoes, butter, buttermilk, and a few other things to make it today. To use up the buttermilk you could follow this main course with the <a href=\"https://spoonacular.com/recipes/buttermilk-pie-134818\">Buttermilk Pie</a> as a dessert. It is a good option if you're following a <b>gluten free and primal</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 90%</b>. This score is tremendous. Try <a href=\"https://spoonacular.com/recipes/twice-baked-sweet-potatoes-with-brown-sugar-pecans-489041\">Twice Baked Sweet Potatoes {with Brown Sugar & Pecans}</a>, <a href=\"https://spoonacular.com/recipes/twice-baked-sweet-potatoes-with-brown-sugar-pecans-marshmallows-584903\">Twice Baked Sweet Potatoes with Brown Sugar, Pecans & Marshmallows</a>, and <a href=\"https://spoonacular.com/recipes/maple-brown-butter-mashed-sweet-potatoes-828414\">Maple Brown Butter Mashed Sweet Potatoes</a> for similar recipes.",
