    "summary": "Green Beans with Garlic Chips might be just the side dish you are searching for. One serving contains <b>178 calories</b>, <b>3g of protein</b>, and <b>13g of fat</b>. This gluten free, primal, and vegetarian recipe serves 4 and costs <b>84 cents per serving</b>. 7 people have tried and liked this recipe. If you have apple cider vinegar, garlic cloves, olive oil, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 45%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/sauteed-green-beans-with-garlic-chips-395227\">Sauteed Green Beans with Garlic Chips</a>, <a href=\"https://spoonacular.com/recipes/garlic-green-beans-644285\">Garlic Green Beans</a>, and <a href=\"https://spoonacular.com/recipes/garlic-green-beans-433417\">Garlic Green Beans</a> for similar recipes.",
