    "imageType": "jpg",
    "summary": "Chicken Cordon Bleu With Mushroom Sauce might be just the main course you are searching for. This recipe makes 4 servings with <b>533 calories</b>, <b>42g of protein</b>, and <b>32g of fat</b> each. For <b>$2.98 per serving</b>, this recipe <b>covers 26%</b> of your daily requirements of vitamins and minerals. Not a lot of people made this recipe, and 5 would say it hit the spot. If you have cooking oil, flour, garlic, and a few other ingredients on hand, you can make it. To use up the white wine you could follow this main course with the <a href=\"https://spoonacular.com/recipes/white-wine-frozen-yogurt-206235\">White Wine Frozen Yogurt</a> as a dessert. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 69%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/chicken-cordon-bleu-with-mushroom-sauce-and-rice-471050\">Chicken Cordon Bleu with Mushroom Sauce and Rice</a>, <a href=\"https://spoonacular.com/recipes/pork-tenderloin-cordon-bleu-with-mushroom-mustard-cream-sauce-202451\">Pork Tenderloin Cordon Bleu with Mushroom-Mustard Cream Sauce</a>, and <a href=\"https://spoonacular.com/recipes/chicken-cordon-bleu-with-creamy-mustard-sauce-492033\">Chicken Cordon Bleu with Creamy Mustard Sauce</a> for similar recipes.",
