    "imageType": "jpg",
    "summary": "The recipe Popcorn Chicken is ready <b>in about 45 minutes</b> and is definitely a tremendous <b>dairy free</b> option for lovers of American food. This recipe serves 2 and costs $1.59 per serving. One serving contains <b>823 calories</b>, <b>43g of protein</b>, and <b>14g of fat</b>. Plenty of people made this recipe, and 100 would say it hit the spot. It works well as a reasonably priced main course. If you have eggs, salt, chili powder, and a few other ingredients on hand, you can make it. To use up the eggs you could follow this main course with the <a href=\"https://spoonacular.com/recipes/rose-levy-beranbaums-chocolate-tomato-cake-with-mystery-ganache-27408\">Rose Levy Beranbaum's Chocolate Tomato Cake with Mystery Ganache</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 96%</b>. This score is great. Try <a href=\"https://spoonacular.com/recipes/popcorn-chicken-how-to-make-kfc-style-popcorn-chicken-666002\">popcorn chicken , how to make kfc style popcorn chicken</a>, <a href=\"https://spoonacular.com/recipes/popcorn-coated-popcorn-chicken-753429\">Popcorn-Coated Popcorn Chicken</a>, and <a href=\"https://spoonacular.com/recipes/champagne-caramel-popcorn-bacon-truffle-parmesan-popcorn-837731\">Champagne Caramel Popcorn & Bacon Truffle Parmesan Popcorn</a> for similar recipes.",
