    "summary": "Chicken Mulligatawny Soup might be just the main course you are searching for. One serving contains <b>369 calories</b>, <b>27g of protein</b>, and <b>10g of fat</b>. For <b>$2.5 per serving</b>, this recipe <b>covers 22%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista has 36 fans. Head to the store and pick up curry powder, cayenne pepper, carrots, and a few other things to make it today. To use up the onion you could follow this main course with the <a href=\"https://spoonacular.com/recipes/candy-corn-cupcakes-63881\">Candy Corn Cupcakes</a> as a dessert. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 76%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/mulligatawny-soup-chicken-94598\">Mulligatawny Soup ( Chicken )</a>, <a href=\"https://spoonacular.com/recipes/chicken-mulligatawny-soup-678904\">Chicken Mulligatawny Soup</a>, and <a href=\"https://spoonacular.com/recipes/chicken-mulligatawny-soup-33379\">Chicken Mulligatawny Soup</a> for similar recipes.",
