    "instructions": "<p>Peel and devein your shrimp. You can leave the tail of the shrimp if you like. Season with the suya pepper spice and set aside.Whisk your egg and set aside.In your bowl of flour, mix in the onion powder, garlic powder, salt, chilli powder and set aside.Take your seasoned shrimp and rub in the seasoned flour, dunk it in the egg mixture and coat with the breadcrumbs.Heat up your oil for frying and fry your shrimps till golden brown on both sides.For your spicy Mayo, Mix 2 tablespoons of mayonnaise with one table spoon of sriracha sauce till properly mixed. Serve it with your breaded shrimp.</p>",
