    "summary": "If you want to add more <b>American</b> recipes to your recipe box, Skillet Sweet Potato Casserole with Bacon, Brown Sugar Crumble might be a recipe you should try. For <b>96 cents per serving</b>, you get a side dish that serves 6. One portion of this dish contains approximately <b>5g of protein</b>, <b>21g of fat</b>, and a total of <b>300 calories</b>. A couple people made this recipe, and 28 would say it hit the spot. <b>Thanksgiving</b> will be even more special with this recipe. This recipe from Pink When requires sweet potatoes, 3 cup butter, pecans, and 2 cup brown sugar. From preparation to the plate, this recipe takes roughly <b>50 minutes</b>. Overall, this recipe earns a <b>not so tremendous spoonacular score of 29%</b>. Similar recipes include <a href=\"https://spoonacular.com/recipes/skillet-sweet-potato-casserole-with-bacon-brown-sugar-crumble-688263\">Skillet Sweet Potato Casserole with Bacon, Brown Sugar Crumble</a>, <a href=\"https://spoonacular.com/recipes/loaded-sweet-potato-soup-with-brown-sugar-bacon-492277\">Loaded Sweet Potato Soup with Brown Sugar Bacon</a>, and <a href=\"https://spoonacular.com/recipes/brown-sugar-cornbread-with-bacon-crumble-585308\">Brown Sugar Cornbread with Bacon Crumble</a>.",
