    "instructions": "InstructionsPreheat your oven to 350 degrees F and have a cast iron skillet or oven-safe baking dish ready.Place the cubed sweet potatoes in a large pot and cover with water. Bring them to a boil over high heat and cook until tender, about 10-15 minutes. Remove from heat and drain. Transfer to a large bowl and mash.To the bowl with mashed sweet potatoes, stir in 1/2 cup of the melted butter, heavy cream, 1/4 cup of the brown sugar, and the salt until fully incorporated. Pour the mixture into the cast iron skillet.In a medium bowl, combine the 1/3 cup melted butter, 1/2 cup brown sugar, flour, pecans, and bacon. Fold the ingredients together until moist crumbles form. Sprinkle the mixture on top of the sweet potato mash.Place the skillet in the oven and bake for 35 minutes or until golden brown. Remove from heat and let stand for 5 minutes before serving.Enjoy!",
