    "summary": "The recipe Poached Prawns with Fettuccine and French String Beans is ready <b>in approximately 45 minutes</b> and is definitely a tremendous <b>pescatarian</b> option for lovers of Mediterranean food. For <b>$2.78 per serving</b>, this recipe <b>covers 22%</b> of your daily requirements of vitamins and minerals. One serving contains <b>475 calories</b>, <b>32g of protein</b>, and <b>18g of fat</b>. Only a few people really liked this main course. This recipe is liked by 7 foodies and cooks. A mixture of string beans, butter, prawns, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the lemon juice you could follow this main course with the <a href=\"https://spoonacular.com/recipes/lemon-shortbread-cookies-with-lemon-icing-a-tribute-to-aunt-roxanne-487814\">Lemon Shortbread Cookies with Lemon Icing {A Tribute to Aunt Roxanne}</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 58%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/french-string-beans-green-beans-tomato-basil-salad-112611\">French String Beans/ Green Beans, Tomato & Basil Salad</a>, <a href=\"https://spoonacular.com/recipes/french-string-beans-and-celery-root-salad-761240\">French String Beans and Celery Root Salad</a>, and <a href=\"https://spoonacular.com/recipes/french-string-bean-salad-309724\">French String Bean Salad</a> for similar recipes.",
