    "summary": "Eggs Florentine might be just the main course you are searching for. One serving contains <b>433 calories</b>, <b>22g of protein</b>, and <b>25g of fat</b>. This recipe serves 4 and costs $2.12 per serving. A couple people made this recipe, and 36 would say it hit the spot. A mixture of kosher salt, spinach, eggs, and a handful of other ingredients are all it takes to make this recipe so tasty. To use up the eggs you could follow this main course with the <a href=\"https://spoonacular.com/recipes/rose-levy-beranbaums-chocolate-tomato-cake-with-mystery-ganache-27408\">Rose Levy Beranbaum's Chocolate Tomato Cake with Mystery Ganache</a> as a dessert. It is a good option if you're following a <b>vegetarian</b> diet. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 84%</b>. This score is awesome. Similar recipes include <a href=\"https://spoonacular.com/recipes/eggs-florentine-430334\">Eggs Florentine</a>, <a href=\"https://spoonacular.com/recipes/eggs-florentine-78065\">Eggs Florentine</a>, and <a href=\"https://spoonacular.com/recipes/eggs-florentine-598015\">Eggs Florentine</a>.",
