    "summary": "Orange Zest Maple Date Bars might be just the dessert you are searching for. This recipe serves 8 and costs $1.63 per serving. One serving contains <b>472 calories</b>, <b>4g of protein</b>, and <b>13g of fat</b>. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. 14 people have made this recipe and would make it again. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. This recipe from Foodista requires flour, water, cup maple syrup, and orange zest. With a spoonacular <b>score of 31%</b>, this dish is rather bad. <a href=\"https://spoonacular.com/recipes/maple-whipped-sweet-potatoes-with-orange-zest-620297\">Maple Whipped Sweet Potatoes with Orange Zest</a>, <a href=\"https://spoonacular.com/recipes/maple-date-bars-616272\">Maple-Date Bars</a>, and <a href=\"https://spoonacular.com/recipes/maple-date-bars-56517\">Maple-Date Bars</a> are very similar to this recipe.",
