    "summary": "This recipe serves 5 and costs $2.24 per serving. One serving contains <b>723 calories</b>, <b>13g of protein</b>, and <b>26g of fat</b>. A few people made this recipe, and 18 would say it hit the spot. It is a good option if you're following a <b>vegetarian</b> diet. A mixture of condensed milk, jello instant vanilla pudding, vanilla, and a handful of other ingredients are all it takes to make this recipe so scrumptious. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 51%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/easy-low-fat-banana-pudding-269400\">Easy Low-Fat Banana Pudding</a>, <a href=\"https://spoonacular.com/recipes/easy-banana-pudding-parfaits-276686\">Easy Banana Pudding Parfaits</a>, and <a href=\"https://spoonacular.com/recipes/easy-southern-banana-pudding-283520\">Easy Southern Banana Pudding</a> for similar recipes.",
